function NewsCategory(){}NewsCategory.prototype.run=function(){this.listenAddNewsCategory(),this.listenEditCategoryEvent(),this.listenDeleteCategorEvent()},NewsCategory.prototype.listenAddNewsCategory=function(){$("#add-category").on("click",function(){myalert.alertOneInput({title:"添加新闻分类",placeholder:"请输入新闻分类",confirmCallback:function(t){myajax.post({url:"/cms/add_news_category/",data:{name:t},success:function(t){200===t.code?window.location.reload():myalert.close()}})}})})},NewsCategory.prototype.listenEditCategoryEvent=function(){$(".edit-btn").on("click",function(){var t=$(this).parent().parent(),e=t.attr("data-pk"),a=t.attr("data-name");myalert.alertOneInput({title:"修改新闻分类",placeholder:"请输入新的新闻分类名称",value:a,confirmCallback:function(t){myajax.post({url:"/cms/edit_news_category/",data:{pk:e,name:t},success:function(t){200===t.code?window.location.reload():myalert.close()}})}})})},NewsCategory.prototype.listenDeleteCategorEvent=function(){$(".delete-btn").on("click",function(){var t=$(this).parent().parent().attr("data-pk");myalert.alertConfirm({title:"你确定要删除此分类吗？",confirmCallback:function(){myajax.post({url:"/cms/delete_news_category/",data:{pk:t},success:function(t){200===t.code?window.location.reload():myalert.close()}})}})})},$(function(){(new NewsCategory).run()});
